angular.module("nbModal").config(["nbModalConfigProvider",function(d){d.template='<div class="modal"><div class="modal-dialog"></div></div>',d.open=function(d){d.find("div.modal").modal({backdrop:"static",show:!0,keyboard:!1})},d.close=function(d){d.find("div.modal").modal("hide")},d.setContent=function(d,o){return d.find("div.modal-dialog").html(o)}}]);